import React from 'react'


const Blog = ({ blog, ...props }) => {

    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
    }

    const handleClick = () => {
        props.history.push(`/blog/${blog.id}`)
    }

    return(
        <div style={blogStyle}>
            <div onClick={() => handleClick()}>
                {blog.title}
            </div>
        </div>
    )
}


export default Blog
